import React from "react";

const Getval = (props)=>{

    const deleteItem = (e)=>{
        console.log("delete");
        e.target.props.text.splice(props.position, 1);
    }

    return(
        <>
            <div className="theitem">
                <li> <i class="fas fa-times-circle" id="myicon" onClick= {deleteItem}></i> {props.text} </li>
            </div>
        </>
    );
}

export default Getval;
